B.NZ=new A.e(B.c,["\u0924\u0924\u094d\u0930\u0948\u0915\u0938\u094d\u0925\u092e\u094d \u091c\u0917\u0924\u094d \u0915\u0943\u0924\u094d\u0938\u094d\u0928\u092e\u094d \u092a\u094d\u0930\u0935\u093f\u092d\u0915\u094d\u0924\u092e\u094d \u0905\u0928\u0947\u0915\u0927\u093e \u0964\n\u0905\u092a\u0936\u094d\u092f\u0924\u094d \u0926\u0947\u0935\u0926\u0947\u0935\u0938\u094d\u092f \u0936\u0930\u0940\u0930\u0947 \u092a\u093e\u0928\u094d\u0921\u0935\u0938\u094d\u0924\u0926\u093e \u0965 \u0967\u0969 \u0965","Then, Arjuna saw the entire universe with its manifold variety over there, in one place inside the body of the Lord of Lords."],t.w)
