B.UI=new A.e(B.c,["\u0909\u0926\u093e\u0938\u0940\u0928\u0935\u0924\u094d \u0906\u0938\u0940\u0928\u094b \u0917\u0941\u0923\u0948\u0930\u094d\u092f\u094b \u0928 \u0935\u093f\u091a\u093e\u0932\u094d\u092f\u0924\u0947 \u0964\n\u0917\u0941\u0923\u093e \u0935\u0930\u094d\u0924\u0928\u094d\u0924 \u0907\u0924\u094d\u092f\u0947\u0935 \u092f\u094b\u093d\u0935\u0924\u093f\u0937\u094d\u0920\u0924\u093f \u0928\u0947\u0902\u0917\u0924\u0947 \u0965 \u0968\u0969 \u0965","The person who is not thrown around by the three qualities , who stays his course isn\u2019t shaken. He remains as if inert, considering that these qualities would keep manifesting as their effects."],t.w)
