B.Us=new A.e(B.c,["\u092e\u093e\u092e\u094d \u091a \u092f\u094b\u093d\u0935\u094d\u092f\u092d\u093f\u091a\u093e\u0930\u0947\u0923 \u092d\u0915\u094d\u0924\u093f\u092f\u094b\u0917\u0947\u0928 \u0938\u0947\u0935\u0924\u0947 \u0964\n\u0938 \u0917\u0941\u0923\u093e\u0928\u094d \u0938\u092e\u0924\u0940\u0924\u094d\u092f\u0947\u0924\u093e\u0928\u094d \u092c\u094d\u0930\u0939\u094d\u092e\u092d\u0942\u092f\u093e\u092f \u0915\u0932\u094d\u092a\u0924\u0947 \u0965 \u0968\u096c \u0965","And the person who serves and experiences Me with constant devotion will completely overcome these qualities . He is cut out to experience the Self in its true form."],t.w)
