B.Wv=new A.e(B.c,["\u0924\u0926\u093f\u0924\u093f \u0905\u0928\u092d\u093f\u0938\u0928\u094d\u0927\u093e\u092f \u092b\u0932\u092e\u094d \u092f\u091c\u094d\u091e \u0924\u092a\u0903 \u0915\u094d\u0930\u093f\u092f\u093e\u0903 \u0964\n\u0926\u093e\u0928\u0915\u094d\u0930\u093f\u092f\u093e\u0903 \u091a \u0935\u093f\u0935\u093f\u0927\u093e\u0903 \u0915\u094d\u0930\u093f\u092f\u0928\u094d\u0924\u0947 \u092e\u094b\u0915\u094d\u0937 \u0915\u093e\u0902\u0915\u094d\u0937\u093f\u092d\u093f\u0903 \u0965 \u0968\u096b \u0965","Activities in the form of worship, discipline and various kinds of charitable deeds are done without being bogged down by expectations by those who desire moksha , saying the word 'tat'."],t.w)
B.Tc=new A.e(B.c,["\u0938\u0926\u094d\u092d\u093e\u0935\u0947 \u0938\u093e\u0927\u0941 \u092d\u093e\u0935\u0947 \u091a \u0938\u0926\u093f\u0924\u093f \u090f\u0924\u0924\u094d \u092a\u094d\u0930\u092f\u0941\u091c\u094d\u092f\u0924\u0947 \u0964\n\u092a\u094d\u0930\u0936\u0938\u094d\u0924\u0947 \u0915\u0930\u094d\u092e\u0923\u093f \u0924\u0925\u093e \u0938\u0924\u094d \u0936\u092c\u094d\u0926\u0903 \u092a\u093e\u0930\u094d\u0925 \u092f\u0941\u091c\u094d\u092f\u0924\u0947 \u0965 \u0968\u096c \u0965","Arjuna, this sound of 'sat' fits in the belief of existence and in the opinion that something is favorable. Further, the 'sat' sound is linked in praiseworthy actions."],t.w)
B.Os=new A.e(B.c,["\u092f\u091c\u094d\u091e\u0947 \u0924\u092a\u0938\u093f \u0926\u093e\u0928\u0947 \u091a \u0938\u094d\u0925\u093f\u0924\u093f\u0903 \u0938\u0924\u094d \u0907\u0924\u093f \u091a\u094b\u091a\u094d\u092f\u0924\u0947 \u0964\n\u0915\u0930\u094d\u092e \u091a\u0948\u0935 \u0924\u0926\u0930\u094d\u0925\u0940\u092f\u092e\u094d \u0938\u0924\u094d \u0907\u0924\u094d\u092f\u0947\u0935\u093e\u092d\u093f\u0927\u0940\u092f\u0924\u0947 \u0965 \u0968\u096d \u0965","Standing in worship, discipline and charity is also called as 'sat'. The actions and people who perform them are also referred to by the word 'sat' itself."],t.w)
